import React, { Component } from 'react';
import './timeline.css';

class TimelineSpecific extends Component {

    constructor(props) {
        super(props);
        this.state = {
            type: props.type
        }
    }

    render() {

        return(

            <button>{this.props.type}</button>
            
        )

    }

};

export default TimelineSpecific;
